import logo from './logo.svg';
import { ColorModeSwitcher } from "./ColorModeSwitcher";
import { ChakraProvider, Box, Grid, GridItem, VStack, Text, Link } from '@chakra-ui/react';

function App() {
  return (
    <ChakraProvider>
      <Box textAlign="center" fonSize='xl'>
        <Grid minH="100vh" p={3}>
          <ColorModeSwitcher justifySelf="flex-end"/>
          <VStack spacing={8}>
            <Text>
              sometext
            </Text>
            <Link></Link>
          </VStack>
        </Grid>
      </Box>
    </ChakraProvider>

  );
}

export default App;
